import Bloglist from './Bloglist';


const Home = () => {

    const [blogs, setBlogs] = useState([
        {title: 'My new website', body: 'lorem ipsum...', authour: 'mario', id: 1 },
        {title: 'Welcome paty!', body: 'lorem ipsum...', authour: 'yoshi', id: 2 },
        {title: 'Web dev top tips', body: 'lorem ipsum...', authour: 'mario', id: 3 },
    ]);

 const handleDelete = (id) => {
    const newBlogs = blogs.filter(blog => blog.id != id);
    setBlogs(newBlogs);
 }

useEffect(() => {
    console.log('use Effect ran');
});

    return (
        <div className="home">           
            <Bloglist blogs={blogs.filter((blog) => blog.authour === 'yoshi')} title="Yoshi's blogs!" handleDelete={handleDelete}/>
            <Bloglist blogs={blogs.filter((blog) => blog.authour === 'mario')} title="Mario's blogs!" handleDelete={handleDelete}/>

        </div>
    )
}

export default Home
